import React from 'react'
import './recommendProduct.css'
import product1 from './product1.jpg'

function recommendProduct() {
  return (
    <div className="recommendProduct">

        <div className='list_photo'>

            <img className="product1"
                        src={product1}
                        alt="" />

            <img className="product2"
                        src={product2}
                        alt="" />

            <img className="product3"
                        src={product3}
                        alt="" />

            <img className="product4"
                        src={product4}
                        alt="" />

            <img className="product5"
                        src={product5}
                        alt="" />


        </div>

    </div>
  )
}

export default recommendProduct
